column2:
Code Black confidential information!

@w3 For your eyes only: @w2 To generate an override code to access the fail-safe data cache, @w2 three code fragments need to be assembled. @w2 The fragments are hidden in <color=#fbff00>three consoles</color>. 

@w2 The fragments need to be assembled on the main command console on the bridge. @p9 The location must remain unknown to all persons below access level BLACK @w4 - at all costs! 

@w2 Please enter credentials again to start the recovery procedure!

column3:
Код BLACK конфиденциальная информация! 
@w3 Только для ваших глаз: @w2 Чтобы сгенерировать код отмены для доступа к отказоустойчивому кэшу данных, @w2 необходимо собрать три фрагмента кода. @w8 Фрагменты спрятаны в <color=#fbff00>трех консолях</color>. @w2 Их нужно собрать на главном командном пульте на мостике. @p9 Местоположение должно оставаться неизвестным всем и каждому лицу ниже уровня доступа Black @w4 - любой ценой! 

@w2 Пожалуйста, введите учетные данные еще раз, чтобы начать процедуру восстановления!

column2:
Mission Planning Room @w2 
T minus 8:02:13 @w2 
Commander Lamarr @w2 
Lt.Commander Zerogen 
@p9 <color=#ffffff>[L]</color> Jennifer, did your team already set up the reworked warp cage for the new schedule? @w2 These guys are crazy. @w2 Rescheduling the start to 24h earlier...
@w2 <color=#9c9c9c>[Z]</color> They literally threw me out of my bed in the middle of the night. @w2 But yes, we managed to get this done just a few minutes before your arrival. 
@w2 <color=#9c9c9c>[Z]</color> Hey, ... @w2 before I forget, @w2 there is a new guy on the bridge ... @w2 Mencer? @w2 Mirse? @w2 Mercer? @w2 Not exactly sure. @w2 Black suit. @w2 Spooky guy. 
@p9 <color=#ffffff>[L]</color> Hmm ... @w2 I sense some trouble. @w2 The whole project has gone a strange route. @w2 Do you remember when we were college students? @w2 When the first team started after the Hyperion was lost? @w2 Analyze the incident. @w2 Build a new science vessel. @w2 We can do it better.. @w2 blah blah .. @w2 all those pathetic speeches? 
@w2 <color=#9c9c9c>[Z]</color> We had a test about the Hyperion Incident and what followed from it in our science class in college. @w2 If I would have known that, @w2 after I signed up 5 years ago, @w2 that they are building a fleet.. @w2 with only two functional warp drives! @w2 I would have taken it for an April Fool's joke. 
@p9 <color=#ffffff>[</color><color=#ffffff>L] </color> Absolutely. @w2 And.. @w2 why do we need those turrets and even combat ships? @w2 And Marines? @w2 And fighters? @w2 For a warp drive test and resource gathering in Proxima Centauri? @w2  Feels more like the Admirals want to invade a solar system. @w2 Like in the old star combat movies we watched last week. 
@w2 <color=#9c9c9c>[Z]</color> If it's like that, I'd better get some sleep. @w2 'May the thought be with you.' 
@w2 <color=#ffffff>[</color><color=#ffffff>L] </color>Haha.. @w2 Send your colleagues to the cabins as well. @w2 You and your team have achieved something next to impossible in the given timeframe. @w2 I'll check the settings with the AI in the next few hours. @w2 Good night! 
@p9 <color=#ffffff>[</color><color=#ffffff>L] </color>THEIA! @w2 Can you please try to sync the incoming waves with the modules to 0.2? @w2 We should try to minimize any signal loop, @w2 or any external disturbance that will make this whole thing into either a giant heater ... @w2 or an uncontrollable wave skimmer. 

@w2 <color=#9c9c9c>[THEIA]</color> Of course, Commander. @w2 Adjustments are in the works.

column3:
Комната планирования миссии @w2 
T минус 8:02:13 @w2 
Командир Ламарр @w2 
Лейтенант-командир Зероген 
@p9 <color=#ffffff>[L]</color> Дженнифер, твоя команда уже установила переработанную варп-клетку по новому расписанию? @w2 Эти ребята сумасшедшие. @w2 Перенос старта на 24 часа раньше...
@w2 <color=#9c9c9c>[Z]</color> Они буквально выкинули меня из кровати посреди ночи. @w2 Но да, мы успели сделать это за несколько минут до твоего прибытия. 
@w2 <color=#9c9c9c>[Z]</color> Эй, ... @w2 прежде чем я забуду, @w2 на мостике новый парень ... @w2 Менсер? @w2 Мирс? @w2 Мерсер? @w2 Точно не уверен. @w2 В черном костюме. @w2 Страшный тип. 
@p9 <color=#ffffff>[L]</color> Хмм ... @w2 Чувствую, что будут проблемы. @w2 Весь проект пошел по странному пути. @w2 Помнишь, когда мы были студентами колледжа? @w2 Когда первая команда начала после того, как Гиперион был потерян? @w2 Анализировать инцидент. @w2 Построить новое научное судно. @w2 Мы можем сделать это лучше.. @w2 бла бла .. @w2 все эти жалкие речи? 
@w2 <color=#9c9c9c>[Z]</color> У нас был тест по инциденту с Гиперионом и его последствиям на уроке науки в колледже. @w2 Если бы я знал, @w2 после того, как подписался 5 лет назад, @w2 что они строят флот.. @w2 с только двумя функциональными варп-двигателями! @w2 Я бы принял это за первоапрельскую шутку. 
@p9 <color=#ffffff>[</color><color=#ffffff>L] </color> Абсолютно. @w2 И.. @w2 зачем нам нужны эти турели и даже боевые корабли? @w2 И морпехи? @w2 И истребители? @w2 Для теста варп-двигателя и сбора ресурсов в Проксиме Центавра? @w2  Больше похоже на то, что адмиралы хотят вторгнуться в солнечную систему. @w2 Как в старых звездных боевых фильмах, которые мы смотрели на прошлой неделе. 
@w2 <color=#9c9c9c>[Z]</color> Если это так, мне лучше поспать. @w2 'Да пребудет с тобой мысль.' 
@w2 <color=#ffffff>[</color><color=#ffffff>L] </color>Хаха.. @w2 Отправь своих коллег в каюты тоже. @w2 Ты и твоя команда достигли почти невозможного в заданные сроки. @w2 Я проверю настройки с ИИ в ближайшие несколько часов. @w2 Спокойной ночи! 
@p9 <color=#ffffff>[</color><color=#ffffff>L] </color>THEIA! @w2 Можешь, пожалуйста, попытаться синхронизировать входящие волны с модулями до 0.2? @w2 Нам следует попытаться минимизировать любой сигнал петли, @w2 или любое внешнее возмущение, которое превратит все это либо в гигантский обогреватель ... @w2 либо в неконтролируемый волновой скиммер. 

@w2 <color=#9c9c9c>[THEIA]</color> Конечно, командир. @w2 Корректировки в процессе.

