column2:
Although the Waverider Protocol knocked me out, the suit subsystems still gathered information. @w2 It seems like the long-range antenna array of this wreckage is still working! 

@w2 If I can power them for just a few minutes, we could send an emergency broadcast. 
@p9 But this would mean the Zirax would send everything they have at this position. Given the military sites nearby, this will leave you with only a few moments to get prepared for them. @w2 <color=#ffffff>Better fight them with your vessel</color>, than on foot. 

@w2 Either way. You need to <color=#fbff00>keep the troops busy for a few minutes</color>, until the antenna completes sending the signal.

column3:
Хотя протокол Waverider вырубил меня, подсистемы костюма все же собирали информацию. @w2 Похоже, что антенная решетка дальнего действия этого обломка все еще работает! 

@w2 Если я смогу привести их в действие хотя бы на несколько минут, мы сможем отправить экстренное сообщение. 
@p9 Но это будет означать, что Зиракс отправит на эту позицию все, что у них есть. Учитывая близлежащие военные объекты, у вас останется всего несколько минут, чтобы подготовиться к ним. @w2 <color=#ffffff>Лучше сражатьься с ними на своем корабле</color>, чем пешком. 

@w2 В любом случае. Вам нужно <color=#fbff00>удерживать эти войска в течении нескольких минут</color>, пока антенна не завершит передачу сигнала.

