Hello my friend! @w2 I am happy to see you still alive ... @w2 This is kind of an urgent call. @w2 We have received some alarming info @w2 ..about the Legacy! @w2 It seems there is more behind it than we believed.  

@w2 Long story short: @w2 The Polaris Megacorps lost one of their capital vessels - @w2 the <color=#ffffff>Ilmarinen</color>.
@p9 The vessel was exploring distant systems for the last few years. @w2 Its goal was to find new worlds and new resources. @w2 The company lost contact with the ship about half a year ago. @w2

They have found its trace, @w2 but because of the Zirax patrols getting much more frequent in the months since your people's arrival, @w2 they are not able to officially investigate themselves. @w2 Now they are asking if we could lend them a hand.

column3:
Привет, мой друг! @w2 Рад видеть тебя в живых... @w2 Это довольно срочный вызов. @w2 Мы получили тревожную информацию @w2 ..о Наследии! @w2 Похоже, за этим стоит больше, чем мы думали. 

@w2 Коротко говоря: @w2 Мегакорпорация Полярис потеряла один из своих капитальных кораблей - @w2 <color=#ffffff>Ильмаринен</color>.
@p9 Корабль исследовал далекие системы последние несколько лет. @w2 Его целью было нахождение новых миров и ресурсов. @w2 Компания потеряла с ним связь около полугода назад. @w2

Они нашли его след, @w2 но из-за того, что патрули Зиракс стали гораздо чаще в последние месяцы после прибытия вашего народа, @w2 они не могут официально провести расследование самостоятельно. @w2 Теперь они спрашивают, могли бы мы им помочь.

column2:
Ah..! @w2 

Finally someone who can make use of this. 

@w2 Hope you can make profit from it, stranger.

column3:
Ах... @w2 

Конечно, кто-то, кто может этим воспользоваться. 

@w2 Надеюсь, ты сможешь извлечь из этого пользу, незнакомец.

column2:
@w2 All of your kind that came through here ended up down there in the cells!... @w8 
But if I were you I would not test my luck!... @w4 

We ran out of cell blocks already, we would have to find a new end for you!... @w4 He He He... @w6

column3:
@w2 Все твои люди, которые прошли сюда, оказались там, в камерах!.... @w8 
Но на твоем месте я бы не стал проверять свою удачу!... @w4 

Камеры у нас уже закончились,  нам придется найти для тебя что-то другое!.... @w4 Хе Хе Хе... @w6

column2:
Last shift casualties for forgetting to equip a suit: 

@w2 Karr, @w2 Skhigh, @w2 Dahh. @w2 

Our thoughts are with them!

 Hostile lifeforms detected in rear hangar bay @p9 Heavy Assault Mechanoid not responsive 
@w5 Ship-Defense-AI has failed authentication handshake 
@w5 Security system compromised. 
@w5 IFF has been disabled @p9 Recommended action: @w4 
Divert Mechanoid security protocols to this console and initiate a hard reboot using the switch on the container. @p9 To initiate a hard reboot and divert security protocols,@w4 enter the code 6662 into the CPU's breaker switch and pull the switch down to lock the Ship-Defense-AI out of the mechanoid control system. @w7
To complete the reboot sequence you must pull the manual override lever on the mechanoid container itself. @w7

End of message

column3:
 В заднем отсеке ангара обнаружены враждебные формы жизни @p9 Тяжелый штурмовой механоид не отвечает 
@w5 ИИ защиты корабля не удалось подтвердить аутентификацию 
@w5 Система безопасности скомпрометирована. 
@w5 IFF отключен @p9 Рекомендуемое действие: @w4 
Перенаправьте протоколы безопасности Механоида на эту консоль и инициируйте жесткую перезагрузку с помощью переключателя на контейнере. @p9 Чтобы инициировать аппаратную перезагрузку и отключить протоколы безопасности,@w4 введите код 6662 в выключатель ЦП и потяните выключатель вниз, чтобы заблокировать ИИ защиты корабля от системы управления механоида. @w7
Чтобы завершить последовательность перезагрузки, вы должны потянуть рычаг ручного управления на самом контейнере механоида. @w7

Конец сообщения

column2:
@q0First things first: <color=#ffffff>Yarod</color> is a scientist who was running the exotic materials lab when the station was still under Polaris control. He had some disagreements with the management of the station, which is said to have led to the station being abandoned and later being captured by Pirates. The role of the station was never fully revealed, and, more astonishing, the Polaris did not even make any attempt to regain control. That's about 10 years ago. @p9 Today the station is known as <color=#ffffff>Sigma Fulcrum</color>. It's run by civilian management and reportedly used by the <color=#ffffff>Salurian pirate clan</color> as a main base of operations. Salurians are not run-of-the-mill Pirates. They are in fact high-tech hackers, counterfeiters, hijackers, traffickers, smugglers, and forgers. They run successful business operations in most of the sectors they operate in. @p9 In the last few months the station also became a source of a new drug: <color=#ffffff>Trilinithane</color>. We would have taken Tril, as they call it, as just another drug. 

But then, Yarod came into play. @p9 He contacted one of our local agents, saying that the drug contains substances that cannot be found in this part of the galaxy. Maybe not even in Andromeda. That caught our interest. As the local agent was killed in what they say was an accident, Yarod volunteered to find out more. He said the source is somewhere <color=#ffffff>in the machine hall level</color> of the asteroid - basically the belly of <color=#ffffff>Sigma Fulcrum</color>. @p9 Just before you arrived, we got an emergency message from the station, calling for help and it was signed by Yarod. @w2 
It would be extremely important to <color=#fbff00>get him out of there</color> and along with any information with you can find.

column3:
@q0Первым делом: <color=#ffffff>Ярод</color> — ученый, который руководил лабораторией экзотических материалов, когда станция еще находилась под контролем Polaris. У него возникли разногласия с руководством станции, что, как говорят, привело к тому, что станция была заброшена и позже захвачена Пиратами. Роль станции так и не была полностью раскрыта, и, что еще более удивительно, Polaris даже не пытались вернуть контроль. Это было около 10 лет назад. @p9 Сегодня станция известна как <color=#ffffff>Sigma Fulcrum</color>. Ею управляет гражданское руководство, и, как сообщается, она используется <color=#ffffff>пиратским кланом Салуриан</color> в качестве основной базы операций. Салуриане — это не обычные Пираты. На самом деле, они высокотехнологичные хакеры, фальшивомонетчики, угонщики, торговцы, контрабандисты и подделыватели. Они ведут успешные бизнес-операции в большинстве секторов, в которых работают. @p9 В последние несколько месяцев станция также стала источником нового наркотика: <color=#ffffff>Трилинифан</color>. Мы бы приняли Трил, как они его называют, за еще один наркотик. 

Но затем в игру вступил Ярод. @p9 Он связался с одним из наших местных агентов, сказав, что наркотик содержит вещества, которые нельзя найти в этой части галактики. Возможно, даже не в Андромеде. Это привлекло наше внимание. Поскольку местный агент был убит в том, что они называют несчастным случаем, Ярод вызвался узнать больше. Он сказал, что источник находится где-то <color=#ffffff>на уровне машинного зала</color> астероида — по сути, в самом сердце <color=#ffffff>Sigma Fulcrum</color>. @p9 Незадолго до твоего прибытия мы получили экстренное сообщение со станции с призывом о помощи, подписанное Яродом. @w2 
Было бы крайне важно <color=#fbff00>вытащить его оттуда</color> и вместе с любой информацией, которую ты сможешь найти.

column2:
@q0Glad you are here! The <color=#ffffff>Salurian</color> are after me. 

The station AI is trying to find and kill me as well. 
We need to do what needs to be done and then quickly get out of here.

column3:
@q0Рад, что ты здесь! <color=#ffffff>Салуриане</color> преследуют меня. 

Искусственный интеллект станции тоже пытается найти и убить меня. 
Нам нужно сделать то, что нужно, и затем быстро убираться отсюда.

column2:
@q0Well done, Commander! We have received the data and are analyzing it to plan our next steps. 

This might take some time. 

Is Yarod alright?

@q0Ah, yes. That's perfectly fine. We could not ask more from him anyway. 

It was an extreme risk. 

Thank god it went well..

@q0Just noticed you are already in the base! Good.

Please meet me in the <color=#ffffff>Command Center</color> right away!

I am afraid I have some bad news we need to speak about.

column3:
@q0Только что заметил, что ты уже на базе! Хорошо.

Пожалуйста, встреться со мной в <color=#ffffff>Command Center</color> немедленно!

Боюсь, у меня есть плохие новости, о которых нам нужно поговорить.

column2:
The SURVIVAL TOOL has three basic modes.: @w1 <color=#ffffff>Defence </color>@w1, <color=#ffffff>Resource </color>@w1, <color=#ffffff>Salvage</color>

@w1 Modes can be switched by pressing <color=#00ff11>R</color>ight <color=#00ff11>M</color>ouse <color=#00ff11>B</color>utton (<color=#00ff11>RMB</color>). 
