Инструмент выживания имеет три основных режима..: @w1 <color=#ffffff>Защита </color>@w2, <color=#ffffff>Ресурсы </color>@w2, <color=#ffffff>Утилизация </color>

@w2 Режимы могут быть переключены нажатием <color=#00ff11>П</color>равой <color=#00ff11>К</color>нопки <color=#00ff11>М</color>ыши (<color=#00ff11>ПКМ</color>). 
