@w1 <i>... @w1 Вы хотите узнать больше?</i>

column2:
Hmm ... I do believe the damage was done on purpose. 

@w2 The glorious past. @w2 The Assembly. @w2 The Legacy. @w2 

A tale of the past. @w2 A story meant to frighten children. A looming threat. The death of many inhabited worlds and the ending of a whole dynasty. @w2 The destruction of a millennium of peace and prosperity ...

column3:
Хмм ... Я верю, что ущерб был нанесен намеренно. 

@w2 Славное прошлое. @w2 Ассамблея. @w2 Наследие. @w2 

Сказка из прошлого. @w2 Рассказ о большой угрозе которым пугали детей. Опустошение обитаемых миров и конец целой династии. @w2 Уничтожение тысячелетия мира и процветания ...

column2:
Ha, @w2 I knew you would be volunteering to find out what is going on! 
@p9 Headquarters has sent us the coordinates of a small vessel they had contact with. @w2 The Ilmarinen crew is said to have had contact with a control station, from where they messaged the pilot of this vessel ... @w2 but the transmission was suddenly lost and the pilot failed to arrive at HQ. @w2 

The <color=#ffffff>control station</color> can be found in the <color=#ffffff>orbit of SYMOS, a barren planet</color> in this system.
@w2 Proceed with great caution. @w2 This could be the first time we've encountered this menace inhundreds of years since it was said to have .. @w2 vanished.

column3:
Ха, @w2 я знал, что ты добровольно согласишься выяснить, что происходит! 
@p9 Штаб 'Полариса' прислал нам координаты небольшого судна, с которым у них был контакт. @w2 Сообщается, что экипаж 'Ильмаринена' имел контакт со станцией управления, откуда они связались с пилотом этого судна... @w2 но передача внезапно пропала, и пилот не смог прибыть в штаб.  @w2 

Станцию управления <color=#ffffff>контрольной станции</color> можно найти на <color=#ffffffff>орбите планеты БАРРЕН</color> в этой системе.
@w2 Действуй с большой осторожностью. @w2 Это может быть первый раз, когда мы можем столкнуться с этой угрозой после того, как сотни лет назад она, как говорят, ... @w2 исчезла.

Не стесняйтесь взять моё <color=#ffffff>парящее судно</color>, который я припарковал неподалеку. @w2 Десантники сняли некоторые устройства... @w2 чтобы продать их... @w2 но они все еще там, в контейнерах. 

@w2 Просто установите их обратно, и все готово.

@w2 Желаю вам всего наилучшего!

column2:
July 26, 2473
@w2 Vice Admiral Benner 
@w2 Commander Mercer 
@p9 <color=#ffffff>[M]</color> Sir! We can't wait any longer. @w2 The unknown enemy is amassing more and more ships. @w2 We've already lost two transports and the TITAN will not stand a chance. @w2 Please, get to the shuttle! 
@w2 <color=#9c9c9c>[Bn]</color> Mercer, this is not your command. @w2 Get out of here @w2 and take Yaden with you. @w2 We still must investigate the anomaly we found when entering this system. @w2 I will report to Admiral Perez on the GRAND. 
@w2 <color=#ffffff>[M]</color> How shall we..? 
@w2 < loud explosion > @w2 < log damaged > 
@p9 <color=#9c9c9c>[Bn]</color> This is Admiral Benner! @w2 All personnel, abandon ship! @w2 I repeat. @w2 ABANDON SHIP! @w2 The TITAN is lost! @w2 All personnel go to the rescue pods! 
@w2 <color=#9c9c9c>[Bn]</color> The GRAND and the rest of the fleet will warp out any minute. I rep... 
@w2 <color=#9c9c9c>[Bn]</color> THEIA! @w2 Make contact to .. @w2 .. the GRAND. 
@w2 <color=#ffffff>[THEIA] </color>Our transceiver is damaged. We can send only, Vice Admiral. 
@w2 <color=#ffffff>[THEIA]</color> Contact established! 
@p9 <color=#9c9c9c>[Bn]</color> Perez.. listen .. @w2 I don't have a lot of time left. @w2 We are pulling the enemies away from you! 

@w2 .. we have de..cted the an...old relict! @w2 A planetary remnant! @w2 The wavefront .. originates from there! @w2 We need to .. stay away from .. 

@w2 <i>..end of message..</i>

column3:
26 июля 2473
@w2 Вице-адмирал Беннер 
@w2 Коммандер Мерсер 
@p9 <color=#ffffff>[M]</color> Сэр! Мы не можем больше ждать. @w2 Неизвестный враг собирает все больше и больше кораблей. @w2 Мы уже потеряли два транспорта, и у ТИТАНА не будет ни единого шанса. @w2 Пожалуйста, к шаттлу! 
@w2 <color=#9c9c9c>[Bn]</color> Мерсер, это не ваша команда. Убирайтесь отсюда и заберите с собой Ядена. @w2 Мы все еще должны исследовать аномалию, которую мы обнаружили при входе в эту систему. Я доложу адмиралу Пересу на ГРАНД. 
@w2 <color=#ffffff>[M]</color> Как мы...? 
@w2 <громкий взрыв > @w2 <журнал поврежден > 
@p9 <color=#9c9c9c>[Bn]</color> Это адмирал Беннер! @w2 Всему персоналу, покинуть корабль! @w2 Повторяю. @w2 ПОКИНУТЬ КОРАБЛЬ! @w2 ТИТАН потерян! @w2 Весь персонал в спасательные капсулы! 
@w2 <color=#9c9c9c>[Bn]</color> ГРАНД и остальной флот выйдут в любую минуту. Я представляю... 
@w2 <color=#9c9c9c>[Bn]</color> ТАБОР! @w2 Установите контакт с ... @w2 ... ГРАНД. 
@w2 <color=#ffffff>[ТАБОР]</color> Наш приемопередатчик поврежден. Мы можем только передавать, вице-адмирал. 
@w2 <color=#ffffff>[ТАБОР]</color> Контакт установлен! 
@p9 <color=#9c9c9c>[Bn]</color> Перес... слушай... @w2 У меня осталось не так много времени. @w2 Мы оттягиваем врагов от тебя! 

@w2 ...мы нашли старый реликт! @w2 Планетарный остаток! @w2 Волновой фронт ... исходит оттуда! @w2 Нам нужно ... держаться подальше от ... 

@w2 <i>...конец сообщения..</i>

