column2:
@d0 Each RANK REWARD can only be collected ONCE.

Rewards that have been collected are removed from the options below.

Important: Make sure your inventory can handle the mass/volume of the item, otherwise the reward might get lost.

column3:
@d0Каждую награду за ранг можно получить только ОДИН раз.

Награды, которые были собраны, удаляются из опций ниже.

Важно: Убедитесь, что ваш инвентарь может выдержать массу/объем предмета, иначе награда может быть потеряна.

