column2:
@d0 We need to make sure this hovercraft is completely operational! @w2 

Would you like to start a <color=#fbff00>tutorial</color> that will <color=#fbff00>guide</color> you through the repair process? @w2

<i>Note: If you don't want to do the tutorial right now, you can look up the necessary procedures later in the TUTORIAL tab of the PDA (<color=#44ff00>F1</color>) under <color=#ffffff>Video Manuals</color> as well as in the <color=#ffffff>Empyriopedia</color> tab under 'Game Mechanics' and 'Starter Info'!</i>

column3:
@d0 Нам нужно убедиться, что это судно на воздушной подушке полностью работоспособно! @w2 

Хочешь ли ты начать <color=#fbff00>учебник</color>, который будет <color=#fbff00>руководить</color> тобой в процессе ремонта? @w2

<i>Примечание: Если ты не хочешь делать учебник прямо сейчас, ты можешь найти необходимые процедуры позже во вкладке TUTORIAL на КПК (<color=#44ff00>F1</color>) в разделе <color=#ffffff>Видеомануалы</color>, а также во вкладке <color=#ffffff>Эмпириопедия</color> в разделах 'Игровая механика' и 'Стартовая информация'! </i>.

column2:
@q0There's always plenty to do here in our settlements. Just go to the people on the farms and plantations and ask them what you can do for them. 

For NOW, I have something to do that is <color=#ffffff>far more important.</color> 

Please talk to our <color=#ffffff>Captain of the Guard</color>. He will give you more instructions. You can find him at the <color=#fbff00>Archery Range</color>.

column3:
@q0Всегда есть чем заняться здесь, в наших поселениях. Просто подойди к людям на фермах и плантациях и спроси их, что ты можешь для них сделать. 

СЕЙЧАС у меня есть кое-что <color=#ffffff>гораздо более важное.</color> 

Пожалуйста, поговори с нашим <color=#ffffff>Капитаном Стражи</color>. Он даст тебе дальнейшие инструкции. Ты можешь найти его на <color=#fbff00>Стрельбище</color>.

column2:
@q0 Hello friend! Have you already spoken with our settlement chief?

If not, please talk to him first. I can give you some <color=#fbff00>directions to his farm</color>.

When you return I would appreciate your help!

column3:
@q0Здравствуй, друг! Ты уже разговаривал с главой нашего поселения?

Если нет, пожалуйста, поговори сначала с ним. <color=#d6ff12>Я могу дать тебе несколько направлений к его ферме</color>.

Когда ты вернешься, я буду благодарен тебе за помощь!

column2:
@q0 @d0This may sound a bit strange, but we urgently need fish guts - or rather a certain parasite that infests the local fish shoals in the <color=#ffffff>deep waters</color>. The parasite itself is harmless, but if you ferment and process it, you get an effective poison that we use for silent arrow hunting.

Can you get us some of this <color=#ffffff>fish parasite</color> (x3)? 

If you accept, I will also provide you with a suitable <color=#fbff00>underwater hunting crossbow</color> for this purpose. Note that you cannot hold the weapon and swim at the same time!

column3:
@q0 @d0Это может показаться немного странным, но нам срочно нужны рыбьи кишки - точнее, определенный паразит, который заражает местные косяки рыб в <color=#ffffff>глубоких водах</color>. Сам паразит безвреден, но если его ферментировать и переработать, то получится эффективный яд, который мы любим использовать для бесшумной охоты со стрелами.

Можешь ли ты достать нам немного этого <color=#ffffffff>рыбьего паразита</color> (x3)? 

Если ты согласишься, я также предоставлю тебе подходящий для этой цели <color=#fbff00>арбалет для подводной охоты</color>. Учти, что ты не сможешь держать оружие и плавать одновременно!

column2:
@q0 @d0 When the sun sets today, you can of course spend the night in your survival tent, but it would possibly be better to <color=#ffffff>build your first shelter</color> early on and equip it with the basic things!

<color=#00ffff>Would you like to start a guided tutorial?</color>

<i>Note: If you don't want to do the tutorial NOW, you can manually activate it LATER in the PDA! </i>

column3:
@q0 @d0 Когда сегодня сядет солнце, ты, конечно, можешь провести ночь в своей палатке выживания, но, возможно, лучше будет <color=#ffffffff>построить свое первое убежище</color> пораньше и оборудовать его базовыми вещами!

<color=#00ffff>Хочешь ли ты начать обучающий курс? </color>

<i>Примечание: Если ты не хочешь проходить курс обучения СЕЙЧАС, ты можешь вручную активировать его ПОСЛЕ в КПК! </i>

column2:
@q0Very good. With the core, capacitor (Solar), and at least one solar panel you can start your base. Keep in mind that the capacitor has to charge first. Depending on the position of your solar panels<color=#ffae00>*</color>, it may take some time until the first power arrives. On the main page and the STATISTICS tab of the control panel (<color=#44ff00>P</color>) you can see the current production and consumption rates. It is best to plan now to install more solar panels because your energy consumption will increase quickly! 
*Efficiency: Yellow LEDs = current, influenced by weather/day/night; Green = day average, influenced by placement @p9 If you have not yet completed the other components (window, door, stairs, and roof repair), you can proceed with this. 

If you want to activate the second part of the Guided Tutorial, select the corresponding answer below to read the instructions!

column3:
@q0Очень хорошо. С Ядром и Конденсатором (Солнечным) и хотя бы одной солнечной панелью ты можешь начать свою базу. Имей в виду, что сначала должен зарядиться Конденсатор. В зависимости от положения твоих солнечных панелей<color=#ffae00>*</color> , может пройти некоторое время, пока появится первая энергия.  На главной странице и на вкладке СТАТИСТИКА панели управления (<color=#44ff00>P</color>) ты можешь увидеть текущий уровень производства и уровень потребления.  Лучше всего уже сейчас планировать установку большего количества солнечных панелей, потому что потребление энергии у тебя будет быстро расти! 
*Эффективность: Жёлтые светодиоды = текущий, на него влияет погода/день/ночь; Зелёные = среднедневной, на него влияет размещение @p9 Если ты ещё не завершил другие компоненты (ремонт окон, дверей, лестниц и крыши), то можешь приступать к этому.  

Если ты хочешь активировать вторую часть Руководства, выбери соответствующий ответ ниже, чтобы прочитать инструкции!

column2:
@d0 @q0The Survival Tool has three working modes that you can set with a <color=#44ff00>right mouse</color> click: <color=#ffffff>Defense</color>, <color=#ffffff>Resource </color>and <color=#ffffff>Salvage</color>. 

The <u>Resource mode</u> is especially important! Use it to gather <color=#ffffff>wood</color> from trees and <color=#ffffff>carbon</color> from resource rocks <u>early on</u> to <color=#ffffff>build your first shelter</color> as soon as possible! You can also use it to destroy plants, stones, and other obstacles that are in your way or prevent you from picking something up! 

Would you like to see a more detailed video about the Survival Tool and its working modes?

column3:
@d0 @q0Инструмент выживания имеет три рабочих режима, которые ты можешь установить с помощью <color=#44ff00>правого клика</color> мыши: <color=#ffffff>Оборона</color>, <color=#ffffff>Ресурс</color> и <color=#ffffff>Спасение</color>. 

Режим <u>Ресурс</u> особенно важен! Используй его для сбора <color=#ffffff>древесины</color> с деревьев и <color=#ffffff>углерода</color> с ресурсных пород <u>раньше</u>, чтобы <color=#ffffff>построить свое первое убежище</color> как можно скорее! Ты также можешь использовать его для уничтожения растений, камней и других препятствий, которые стоят на твоем пути или мешают тебе что-то поднять! 

Хочешь посмотреть более подробное видео об инструменте выживания и его рабочих режимах?

column2:
@d0 @q0<color=#00ffff>Ownership = Control!</color> 
When the core is destroyed, all devices, defenses, doors, etc. will stop working until you take control of the base by placing your own core.

Once you own the base, you will be able to access and control all of the base's functions through the control panel (P). Even turrets and other defenses will then work in your favor!

@p9 @d0 @q0<color=#00ffff>Ownership = More efficient looting!</color>

If you're in the mood for a looting spree, you can use the logistics function (F4) to empty containers faster and easier.

@p9 @d0 @q0<color=#00ffff>Ownership = More efficient building </color>

If you own the base and you already have a <color=#ffffff>Multi Tool</color> unlocked in the Tech Tree (<color=#44ff00>F3</color>), you can <color=#ffffff>get back complete blocks and devices </color>with the RETRIEVE BLOCKS setting! If you find a rare device or turret this approach is the only way you can use it for yourself!

column3:
@d0 @q0<color=#00ffff>Владение = контроль!</color> 
Когда ядро уничтожено, все устройства, защитные сооружения, двери и т.д. перестанут работать, пока ты не установишь контроль над базой, поместив туда собственное ядро.

Когда ты станешь владельцем базы, ты сможешь получить доступ и контролировать все ее функции через панель управления (P). Даже турели и другие защитные сооружения будут работать в твою пользу!

@p9 @d0 @q0<color=#00ffff>Владение = более эффективное разграбление!</color>


Если ты настроен на разграбление, ты можешь использовать функцию логистики (F4), чтобы быстрее и проще опустошать контейнеры. 

@p9 @d0 @q0<color=#00ffff>Собственность = более эффективное строительство</color>


Если ты владеешь базой и у тебя уже есть <color=#ffffff>Мультиинструмент</color>, разблокированный в Технологическом дереве (<color=#44ff00>F3</color>), ты можешь <color=#ffffffff>получать обратно целые блоки и устройства</color> с помощью настройки RETRIEVE BLOCKS! Если ты найдешь редкое устройство или турель, то такой подход - единственный способ использовать его для себя!

