column3:
@q0 @d0 <color=#ffffff>Добро пожаловать в архив </color><color=#44ff00>Talon</color><color=#ffffff> QUEST! </color>
В этом архиве перечислены все АКТИВНЫЕ квесты, которые ты выбрал на данный момент от фракции Talon.
