column2:
@q0 @d0 You have reached <color=#ffffff>level 3! </color>Before planning anything else - if not done yet - you should consider <color=#ffffff>building a Hover Vessel (HV)</color> to increase your <color=#ffffff>protection</color> and <color=#ffffff>transportation</color> capabilities!

<color=#00ffff>Would you like to start a guided tutorial?</color>

<i>Note: If you don't want to do the tutorial NOW, you can manually activate it LATER in the PDA! </i>

column3:
@q0 @d0 Ты достиг <color=#ffffff>уровня 3! </color> Прежде чем планировать что-то еще - если это еще не сделано - ты должен подумать о <color=#ffffff>постройке парящего судна (HV)</color>, чтобы увеличить свои <color=#ffffffff>защитные</color> и <color=#ffffffff>транспортные</color> возможности! 

<color=#00ffff>Хочешь начать управляемое обучение?</color>

<i>Примечание: Если ты не хочешь проходить обучение СЕЙЧАС, ты можешь вручную активировать его ПОСЛЕ в КПК! </i>

column2:
@q0You have reached <color=#ffffff>level 5</color> and can now use your points to unlock e.g. the <color=#ffffff>Light Armor</color> or even more equipment and devices for your Hover Vessel and Bases. For now, you should consider building a <color=#ffffff>Small Vessel (SV)</color> to get to the high ground!

<color=#ffffff>Would you like to start a guided tutorial?</color>

<i>Note: If you don't want to do the tutorial right NOW, you can manually activate it LATER in the PDA (F1) > TUTORIAL tab > </i><color=#ffffff>Guided Tutorial: Small Vessel (BP) - Start</color>

column3:
@q0Ты достиг <color=#ffffff>уровня 5</color> и теперь можешь использовать свои очки, чтобы разблокировать, например, <color=#ffffff>Легкую броню</color> или еще больше оборудования и устройств для твоего парящего судна и базы. Пока что тебе стоит подумать о постройке <color=#ffffff>Малого судна (SV)</color>, чтобы добраться до высот!

<color=#ffffff>Хочешь начать обучающий курс?</color>

<i>Примечание: Если ты не хочешь проходить обучающий курс прямо СЕЙЧАС, ты можешь вручную активировать его ПОСЛЕ в PDA (F1) > вкладка TUTORIAL > </i><color=#ffffffff>Управляемый курс: Small Vessel (BP) - Start</color>.

column2:
@q0 @d0 To build a <color=#ffffff>Hover Vessel</color> only a few steps are necessary. In this tutorial, I will show you how to get a quick result with the help of the <color=#ffffff>Blueprint Libary</color> (<color=#44ff00>F2</color>) by using a <color=#ffffff>FRAME</color>.

We will then equip this frame with the necessary functional parts.

Note: The FRAME is marked with <color=#ffffff>NUMBERS</color> that indicate the <u>necessary parts, their position</u>, and a suggested (!) <u>installation sequence</u>!

column3:
@q0 @d0 Чтобы построить <color=#ffffff>Малое судно</color>, необходимо всего несколько шагов.  В этом руководстве я покажу тебе, как получить быстрый результат с помощью <color=#ffffff>Blueprint Libary</color> (<color=#44ff00>F2</color>), используя <color=#ffffffff>FRAME</color>. 
Затем мы оснастим эту раму необходимыми функциональными частями.


Примечание: Рама помечена <color=#ffffffff>Цифрами</color>, которые указывают на <u>необходимые части, их положение</u> и предлагаемую (!) <u>последовательность установки</u>!

column2:
@q0 @d0Open the Blueprint Libary (<color=#44ff00>F2</color>). Select the tab '<color=#ffffff>PREFABS</color>' on the left side <color=#00ffff>( 1 )</color>. Set the filter '<color=#ffffff>Base</color>' <color=#00ffff>( 2 )</color>. Enter the word '<color=#ffffff>Frame</color>' in the search field <color=#00ffff>( 3 )</color>. Select one of the FRAMEs <u>you have the materials for</u> and click the '<color=#ffffff>TO FACTORY</color>' <color=#00ffff>( 4 )</color> button on the <color=#ffffff>lower right</color> screen.

In the new window, drag all materials, for example, the <color=#ffffff>Wood Planks</color> from your inventory into the '<color=#ffffff>INTAKE</color>' box <color=#00ffff>( 5 )</color>. When all requirements are <color=#44ff00>GREEN</color> <color=#00ffff>( 6 )</color>, press <color=#ffffff>START PRODUCTION</color> <color=#00ffff>( 7 )</color>. 
The crafting will take a few minutes. You can close the window. As soon as the production is <color=#ffffff>complete</color> you will get a <color=#ffffff>notification on your screen</color>!

column3:
@q0 @d0Открой Blueprint Libary (<color=#44ff00>F2</color>). Выбери вкладку '<color=#ffffff>PREFABS</color>' в левой части <color=#00ffff>( 1 )</color>. Установи фильтр '<color=#ffffff>Base</color>' <color=#00ffff>( 2 )</color>. Введи слово '<color=#ffffff>Frame</color>' в поле поиска <color=#00ffff>( 3 )</color>. Выбери одну из рам <u>у тебя есть материалы</u> и нажми кнопку '<color=#ffffff>TO FACTORY</color>' <color=#00ffff>( 4 )</color> на экране <color=#ffffff>в правом нижнем углу</color>. 


В новом окне перетащи все материалы, например, <color=#ffffff>Деревянные доски</color> из своего инвентаря в поле '<color=#ffffff>INTAKE</color>' <color=#00ffff>( 5 )</color>. Когда все требования будут <color=#44ff00>ЗЕЛЕНЫЕ</color> <color=#00ffff>( 6 )</color>, нажми <color=#ffffff>START PRODUCTION</color> <color=#00ffff>( 7 )</color>. 
Производство займет несколько минут. Ты можешь закрыть окно. Как только производство будет <color=#ffffff>завершено</color>, ты получишь <color=#ffffff>уведомление на своем экране</color>!

column2:
@q0 @d0Open the Blueprint Libary (<color=#44ff00>F2</color>). Select the tab '<color=#ffffff>PREFABS</color>' on the left side <color=#00ffff>( 1 )</color>. Set the filter '<color=#ffffff>Hover Vessel</color>' <color=#00ffff>( 2 )</color>. Enter the word '<color=#ffffff>Frame</color>' in the search field <color=#00ffff>( 3 )</color>. Select a <color=#ffffff>HV Frame A</color> and click the '<color=#ffffff>TO FACTORY</color>' <color=#00ffff>( 4 )</color> button on the <color=#ffffff>lower right</color> screen.

In the new window, drag all materials, for example, the <color=#ffffff>Carbon Substrate</color> from your inventory into the '<color=#ffffff>INTAKE</color>' box <color=#00ffff>( 5 )</color>. When all requirements are <color=#44ff00>GREEN</color> <color=#00ffff>( 6 )</color>, press <color=#ffffff>START PRODUCTION</color> <color=#00ffff>( 7 )</color>. 
The crafting will take a few minutes. You can close the window. As soon as the production is <color=#ffffff>complete</color> you will get a <color=#ffffff>notification on your screen</color>!

column3:
@q0 @d0Открой библиотеку чертежей (<color=#44ff00>F2</color>). Выбери вкладку '<color=#ffffff>PREFABS</color>' в левой части <color=#00ffff>( 1 )</color>. Установи фильтр '<color=#ffffff>Hover Vessel</color>' <color=#00ffff>( 2 )</color>. Введи слово '<color=#ffffff>Рама</color>' в поле поиска <color=#00ffff>( 3 )</color>. Выбери <color=#ffffff>HV Frame A</color> и нажми кнопку '<color=#ffffff>TO FACTORY</color>' <color=#00ffff>( 4 )</color> на <color=#ffffff>нижнем правом</color> экране. 

В новом окне перетащи все материалы, например, <color=#ffffff>углеродную подложку</color> из своего инвентаря в поле '<color=#ffffff>INTAKE</color>' <color=#00ffff>( 5 )</color>. Когда все требования будут <color=#44ff00>ЗЕЛЕНЫЕ</color> <color=#00ffff>( 6 )</color>, нажми <color=#ffffff>START PRODUCTION</color> <color=#00ffff>( 7 )</color>. 
Производство займет несколько минут. Ты можешь закрыть окно. Как только производство будет <color=#ffffff>завершено</color>, ты получишь <color=#ffffff>уведомление на свой экран</color>!

column2:
@d0 @q0 With this dialog you can send us your feedback directly and anonymously from within the game!

Select the <color=#fbff00>answer option</color> you would like to give feedback on below, eg 'Tutorial'. A window will open where you can use your mouse and keyboard to answer the questions and submit the feedback form.

<color=#ffffff>We thank you now for your active help to improve Empyrion!</color>

column3:
@d0 @q0 С помощью этого диалога ты можешь отправить нам свой отзыв напрямую и анонимно, не выходя из игры!

Выбери ниже <color=#fbff00>вариант ответа</color>, по которому ты хотел бы оставить отзыв, например, 'Tutorial'.  Откроется окно, в котором ты можешь использовать мышь и клавиатуру, чтобы ответить на вопросы и отправить форму обратной связи.

<color=#ffffff>Мы благодарим тебя уже сейчас за твою активную помощь в улучшении Empyrion!</color>.

column2:
@d0 @q0 To report a bug, please use the forum at <color=#ffffff>empyriononline.com</color> until further notice so that we can ask back questions on your report!

(Unfortunately it is not yet possible to do this directly via a survey form).

<color=#00ffff>Thank you very much for your help!</color>

column3:
@d0 @q0 Чтобы сообщить об ошибке, пожалуйста, используй форум на <color=#ffffff>empyriononline.com</color> до дальнейшего уведомления, чтобы мы могли задать вопросы по твоему отчету!

(К сожалению, пока это невозможно сделать напрямую через форму опроса).

<color=#00ffff>Большое спасибо за твою помощь!</color>

column2:
@d0 @q0<b>Thanks for trying the new 'Ashon' game start.</b>
Please take a few moments to rate it, so we can improve the game start with your feedback! 

Note: If you want to continue playing, you can simply close the dialog: This survey is also available from the feedback forum at empyriononline.com!

@d0 @q0Ha. Haha.. sure. 

Here's a fine brew you should try. A TOP root beer.. has gotten pretty rare the last few weeks.

So what do you want to know?

@q0Good afternoon, sir!
You must be the announced specialist that headquarters wanted to send us!

Please report immediately to Commander Pendrell up in the shuttle's cockpit.

@q0Hello, sir! I assume you are the <color=#ffffff>specialist</color> we've been waiting for? 

You seem to have been through quite a bit. 
May I ask what happened?

column3:
@q0Здравствуйте, сэр! Полагаю, вы и есть тот самый <color=#ffffff>специалист</color>, которого мы ждали? 

Вы, кажется, прошли через многое. 
Могу ли я спросить, что случилось?

column2:
@q0Don't be worried, Biological. 

We many are one and one is many things. Nothing is lost. The frenzies have lost their connection. 

Their essence will be harvested.

column3:
@q0Не волнуйся, Биологический. 

Мы многие - это одно, а одно - это много. Ничто не потеряно. Безумцы потеряли свою связь. 

Их сущность будет собрана.

column2:
@q0Hm. We are ... surprised. The biological, similar to you but not the same, was already here. His name. Pendrell?

Yes, that's his name. He wanted our essence. But we couldn't give it to him. He didn't understand. He became angry. He threatened. 

We... @w1 The metal ones are back! Quick, Biological. <color=#ffffff>Please, you must defend us!</color>

column3:
@q0Hm. Мы... удивлены. Биологическое существо, похожее на вас, но не такое же, уже было здесь. Его имя. Пендрелл?

Да, это его имя. Ему нужна была наша сущность. Но мы не могли ему ее дать. Он не понял. Он разозлился. Он угрожал. 

Мы... @w1 Металлические вернулись! Быстрее, Биологический. <color=#ffffff>Пожалуйста, вы должны защитить нас!</color>

column2:
@q0You have been assigned to us as a specialist for difficult missions. Just in time, because one of our science teams, lead by <color=#ffffff>Dr. Hendrell</color> has not reported in for some time. He was supposed to take samples in the Northern glacier region two days ago. 

Your first task: <color=#ffffff>please go and see what's going on</color>. 

And take a weapon with you; the Hishkal are becoming more and more aggressive.

column3:
@q0Вы были назначены к нам в качестве специалиста по сложным миссиям. Как раз вовремя, потому что одна из наших научных групп, возглавляемая <color=#ffffff>доктором Хендреллом</color>, уже некоторое время не появлялась. Он должен был взять пробы в районе северного ледника два дня назад. 

Ваше первое задание: <color=#ffffff>пойдите и посмотрите, что происходит</color>. 

И возьмите с собой оружие; Хишкал становятся все более и более агрессивными.

column2:
@q0Are you ready yet? This task is of utmost importance!

As I said, <color=#fbff00>follow the marker</color> and find <color=#ffffff>Dr. Hendrell</color> and our science team and see what's going on. 
Bring appropriate armament and save whatever can be saved.

column3:
@q0Вы уже готовы? Это задание чрезвычайной важности!

Как я сказал, <color=#fbff00>следуйте за маркером</color> и найдите <color=#ffffff>Доктора Хендрелла</color> и нашу научную команду и посмотрите, что происходит. 
Возьмите с собой соответствующее вооружение и спасите все, что можно спасти.

column2:
@q0Ah, the so-called specialist. That's close enough, Sir! 

I have a question, if I may. How is it that no one at headquarters knows about you? Who are you? Why are you disturbing my work here? Anyway, Goodbye . . Specialist. 

I won't forget their help when I return the favor you did me…

column3:
@q0Ah, так называемый специалист. Достаточно близко, сэр! 

У меня вопрос, если позволите. Как получилось, что никто в штабе не знает о вас? Кто вы такой? Почему вы мешаете мне работать здесь? В любом случае, до свидания. . Специалист. 

Я не забуду их помощь, когда верну услугу, которую вы мне оказали...

column2:
@q0Pendrell escaped? That bastard. We risked our lives for him, and he was only after those Hishkal and their ... Essence? 
I didn't think they were intelligent ... Damn. They'll probably never trust us again. We have some making up to do. As interim commander, that will be my job. At least, thanks to you, a beginning has been made. 

I won't forget that!

column3:
@q0Пендрелл сбежал? Вот ублюдок. Мы рисковали жизнью ради него, а ему нужны были только Хишкал и их... Сущность? 
Я не думал, что они разумны... Проклятье. Они, наверное, больше никогда нам не поверят. Нам нужно исправиться. Как временный командир, это будет моей работой. По крайней мере, благодаря вам, начало положено. 

Я этого не забуду!

column2:
@q0The report has been sent and something is already happening! 
Ships are approaching and I'm reading strong stray radiation from the shuttle!

Commander, <color=#ffffff>Technical Officer Rend</color> is calling you!

column3:
@q0Отчет отправлен, и что-то уже происходит! 
Корабли приближаются, и я фиксирую сильное рассеянное излучение от шаттла!

Командир, <color=#ffffff>Технический Офицер Ренд</color> вызывает тебя!

column2:
@q0Oi! No loitering around at our base!

If you are from the traders guild, I might let you through.. or rob you. 

What shall it be?

column3:
@q0Oi! 

Если вы из гильдии торговцев, я могу вас пропустить... или ограбить. 

Что делать?

column2:
@q0Oi! Cool man. Did not mean to argue with you.. please be our guest. 

Check with <color=#ffffff>Captain Sehk</color>. You can find him <color=#fbff00>somewhere up in the ship</color>.

I will lower the ramps for you.

column3:
@q0Ой! Круто, чувак. Не хотел спорить с тобой.. пожалуйста, будь нашим гостем. 

Обратись к <color=#ffffff>Капитану Сехку</color>. Ты можешь найти его <color=#fbff00>где-то на корабле</color>.

Я опущу для тебя рампы.

@q0Поздравляю, молодой человек. Тебе пора в путь! <color=#ffffff>Ищите старую или заброшенную базу</color>. Оттуда вы сможете выследить LAOCAI и найти его главную базу. Как я всегда говорю: 

Всегда можно получить невезение бесплатно, но для успеха нужно работать! 

Доброго Вам пути! Мы уже пакуем вещи... конечно, в качестве меры предосторожности.

column2:
@q0What a funny action that was, wasn't it? You made a huge mess, but you also cleaned it up to the last lump! Everyone here is thrilled with you!

<color=#ffffff>Sehk wants to see you</color>, by the way!

Oh, and by the way, congratulations my boy! You have more than earned my respect.

column3:
@q0Какая забавная была акция, не правда ли? Вы устроили огромный беспорядок, но при этом убрали его до последнего комочка! Все здесь в восторге от тебя!

<color=#ffffff>Сехк хочет тебя видеть</color>, кстати!

Ох, и кстати, поздравляю, мой мальчик! Ты более чем заслужил мое уважение.

column2:
@q0Have you activated the <color=#ffffff>satellite</color> yet? I don't want to push, especially since you're taking all the risk, but it's a bit urgent. 

If the <color=#ffffff>Clearance Key</color> doesn't work, you might have to hack the console. 
You can do this manually, but you will have a better chance of doing this with the <color=#ffffff>Fire Stick</color> I gave you.

column3:
@q0Ты уже активировал <color=#ffffff>спутник</color>? Я не хочу давить, тем более, что вы берете на себя весь риск, но это немного срочно. 

Если <color=#ffffff>ключ разблокировки</color> не сработал, возможно, вам придется взломать консоль. 
Вы можете сделать это вручную, но у вас будет больше шансов сделать это с помощью <color=#ffffff>Fire Stick</color>, которую я вам дал.

column2:
@q0Your mission was a full success! The first ships of the fleet will arrive shortly, but we can't wait until then. 

Can we count on you again? 
<color=#fbff00>Then come back to me afterwards!</color>

column3:
@q0Ваша миссия была полностью успешной! Первые корабли флота прибудут в ближайшее время, но мы не можем ждать до тех пор. 

Можем ли мы снова рассчитывать на вас? 
<color=#fbff00>После этого возвращайтесь ко мне!</color>

column2:
@q0I knew I could count on you! On to the next task: We must recapture the <color=#ffffff>command center </color>on the <color=#ffffff>moon</color>. It controls the majority of the warlord's aerial and ground units. 

<color=#ffffff>Destroy its core</color> to shut down the facility. 
With some luck, I can get you some air support on short notice. I'll let you know when it's available!

column3:
@q0Я знал, что могу на тебя рассчитывать! Переходим к следующему заданию: Мы должны захватить <color=#ffffff>командный центр</color> на <color=#ffffff>Луне</color>. Здесь сосредоточена большая часть воздушных и наземных войск военачальника. 

<color=#ffffff>Уничтожьте его ядро</color>, чтобы закрыть объект. 
Если повезет, я смогу обеспечить вам поддержку с воздуха в кратчайшие сроки. Я дам вам знать, когда она будет доступна!

column2:
@q0Preparation is everything, isn't it? To destroy the core of the command center, you should bring some firepower. 

Only when its <color=#ffffff>Core</color> is destroyed can the warlord no longer coordinate his units directly. 

Listen to your radio. I'll let you know when we can send in reinforcements!

column3:
@q0Подготовка - это все, не так ли? Чтобы уничтожить ядро командного центра, нужно взять с собой огневую мощь. 

После уничтожения <color=#ffffff>ядра</color> военачальник больше не может напрямую координировать свои подразделения. 

Прислушивайтесь к рации. Я дам вам знать, когда мы сможем прислать подкрепление!

column2:
@q0That was amazing! There are still pockets of resistance, but it'll just be a matter of time. We could also reactivate the <color=#ffffff>long-range teleporter</color> in the station already.

I won't forget your help! On behalf of the Prenn Trade Federation, I would like to officially express our gratitude to you. 

Here's to good business!

column3:
@q0Это было потрясающе! Всё ещё есть очаги сопротивления, но это лишь вопрос времени. Мы также могли бы уже реактивировать <color=#ffffff>дальнобойный телепорт</color> на станции.

Я не забуду твою помощь! От имени Торговой Федерации Пренн, я хотел бы официально выразить нашу благодарность тебе. 

За хороший бизнес!

