column2:
@w2 Command Meeting Room 
@w2 T minus 23:02:13 
@w2 Admiral Yaden
@w2 Vice Admiral Benner 
@w2 Commander Mercer 
@p9 <color=#ffffff>[Y]</color> Hello, Mr. Mercer. @w2 The Council is sending you over for another last minute stress test? 
@w2 <color=#9c9c9c>[M]</color> Admiral. @w3 Vice Admiral. 
@w2 <color=#ffffff>[Bn]</color> Please have a seat, Mercer. 
@w2 <color=#9c9c9c>[M]</color> Thanks, Vice Admiral. 
@w2 <color=#ffffff>[Y]</color> So..? @w2 Why are we meeting here? @w3 Has the start been postponed again? 
@w2 <color=#9c9c9c>[M]</color> No Sirs. @w2 The opposite has happened. 
@p9 <color=#9c9c9c>[M] </color>The scheduled start has been set to 1600. @w2 Tomorrow. 
@w2 <color=#ffffff>[Y]</color> What? @w2 Mercer! @w2 Can you please tell the Council, that this is at least 24h too early? @w2 The warp drives are not ready. @w2 Not to mention all the other stuff that is missing... 
@w2 <color=#9c9c9c>[M]</color> I am afraid, the countdown has already started. @w2 The other commanders will be informed in an hour about the new schedule. @w2 I checked the status of all ships. @w2 We should be ready, even for this accelerated schedule. @p9 <color=#ffffff>[Bn]</color> I just checked the new mission parameters. @w2 All shore leaves have been canceled. @w2 The personnel on Apollon station, @w2 Titan station, and the marine bases will be sent to the transports in the next 12h. @w2 Seems there is no way back, hmm? 
@w2 <color=#9c9c9c>[M]</color> No. @w2 The time window of the 'Event' is set and will be open only for a minute, perhaps less. 
@p9 <color=#ffffff>[Y]</color> Ok. @w2 Then, so be it. @w2 We knew this could happen. 
@w2 <color=#ffffff>[Y] </color>Mr. Benner, @w2 please commence the start protocols. 
@w2 <color=#9c9c9c>[Bn]</color> Aye, Sir. 
@p9 <color=#ffffff>[Y]</color> Mr. Mercer, @w2 we have installed the control station you requested. @w2 It is locked with your credentials.
@w2 <color=#9c9c9c>[M]</color> Thanks, Sir. 
@w2 <color=#ffffff>[Y]</color> THEIA! @w2 Condition yellow at 10 00 tomorrow morning. 
@w2 <color=#9c9c9c>[THEIA] </color>Affirmative, Sir. 
@w2 <color=#ffffff>[Y]</color> Ok, gentlemen, @w2 let's add a new chapter to mankind's history!

column3:
@w2 Зал совещаний командования 
@w2 T минус 23:02:13 
@w2 Адмирал Яден
@w2 Вице-адмирал Беннер 
@w2 Коммандер Мерсер 
@p9 <color=#ffffff>[Y]</color> Здравствуйте, мистер Мерсер. Совет посылает вас на очередной стресс-тест? 
@w2 <color=#9c9c9c>[M]</color> Адмирал. @w3 Вице-адмирал. 
@w2 <color=#ffffff>[Bn]</color> Пожалуйста, присаживайтесь, Мерсер. 
@w2 <color=#9c9c9c>[M]</color> Спасибо, вице-адмирал. 
@w2 <color=#ffffff>[Y]</color> Итак...? @w2 Почему мы собрались здесь? @w3 Старт снова откладывается? 
@w2 <color=#9c9c9c>[M]</color> Нет, господа. @w2 Произошло обратное. 
@p9 <color=#9c9c9c>[M]</color> Начало назначено на 1600. @w2 Завтра. 
@w2 <color=#ffffff>[Y]</color> Что? @w2 Мерсер! @w2 Вы не могли бы сообщить Совету, что это по крайней мере на 24 часа раньше. Варп-двигатели не готовы. Не говоря уже обо всем остальном, чего не хватает... 
@w2 <color=#9c9c9c>[M]</color> Боюсь, обратный отсчет уже начался. @w2 Остальные командиры будут проинформированы о новом расписании через час. @w2 Я проверил состояние всех кораблей. @w2 Мы должны быть готовы даже к такому ускоренному графику. @p9 <color=#ffffff>[Bn]</color> Я только что проверил новые параметры миссии. Все отпуска на берег отменены. Персонал станции Аполлон, станции Титан и морских баз будет отправлен на транспорты в течение следующих 12 часов. @w2 Похоже, пути назад нет, да? 
@w2 <color=#9c9c9c>[M]</color> Нет. @w2 Временное окно 'События' установлено и будет открыто только в течение минуты, возможно, меньше. 
@p9 <color=#ffffff>[Y]</color> Хорошо. @w2 Тогда так тому и быть. @w2 Мы знали, что это может случиться. 
@w2 <color=#ffffff>[Y]</color> Мистер Беннер, @w2 пожалуйста, начните стартовые протоколы. 
@w2 <color=#9c9c9c>[Bn]</color> Есть, сэр. 
@p9 <color=#ffffff>[Y]</color> Мистер Мерсер, @w2 мы установили запрошенную вами станцию управления. Она заблокирована вашими учетными данными.
@w2 <color=#9c9c9c>[M]</color> Спасибо, сэр. 
@w2 <color=#ffffff>[Y]</color> ТИА! @w2 Состояние желтого цвета в 10 00 завтра утром. 
@w2 <color=#9c9c9c>[THEIA]</color> Подтверждаю, сэр. 
@w2 <color=#ffffff>[Y]</color> Итак, господа, @w2 давайте впишем новую главу в историю человечества!

column2:
Warp Core Control Room
@w2 T minus 5:02:13
@w2 Commander Lamarr [L]
@w2 Commander Mercer [M]
@p9 <color=#9c9c9c>[M]</color> Hello, Commander Lamarr!
@w2 <color=#ffffff>[L]</color> Oh, hello Commander Mercer. @w2 Nice to have you here. @w2 I've heard you are now responsible for the warp engines and the protocols. @w2 And for having overwritten my repair protocols and tests the moment you stepped on board the TITAN? @w2 So, how can I help you?
@w2 <color=#9c9c9c>[M]</color> I am just having a look at the warp core. @w2 Impressive!
@w2 <color=#ffffff>[L]</color> Yes. @w2 Unbelievable what the techs pulled out of that pile of junk in Antarctica four decades ago. 
@p9 <color=#ffffff>[L] </color>Nothing but destroyed devices and incomplete blueprints but now, somehow it just magically works. @w2 You know what I mean.
@w2 <color=#9c9c9c>[M]</color> Yes, indeed.
@w2 <color=#ffffff>[L]</color> Just a question, if you don't mind? @w2 What exactly are you doing here?
@w2 <color=#9c9c9c>[M]</color> As I said, having a look at the warp core and its optimizations.
@w2 <color=#ffffff>[L]</color> Hmm. @w2 Ok. @w2 Then enjoy your stay. @w2 I am setting up the final routines. @w2 Or do you want to rewrite them right away?
@w2 <color=#9c9c9c>[M]</color> No worries. @w2 It seems there have been no issues with the schedule being moved forward, yes?@p9 <color=#ffffff>[L]</color> Er, @w2 ahem, @w2 No. @w2 Sure. @w2 The teams have made exceptional progress since some office-sitter decided to throw them out of their beds. @w2 This, after already working weeks with nearly no sleep.
@w2 <color=#9c9c9c>[M]</color> That's obviously the risk of working in the expedition fleet, right?
@w2 <color=#ffffff>[L]</color> Ha ha. @w2 Tell you what, this whole 'expedition' thing is going a strange route. @w2 Not to mention, there's a Council that governs all the decisions and the UCH is somehow in the dark. @w2 Don't you think this requires some additional ... @w2 explanation?
@p9 <color=#9c9c9c>[M]</color> No. What should we explain? @w2 To whom? @w2 There is nothing secret about the expedition, for those that are involved. @w2 We'll tell the people what they need to know.
@w2 <color=#ffffff>[L]</color> Yes. That's exactly my point! As you might know, my grandpa was the lead engineer on the Hyperion. @w2 He was not lost with the ship only for one simple reason: someone decided to reschedule his shift. @w2 I'm thankful for that, but my grandpa never managed to get rid of the stigma of 'the coward that was left behind'.
@p9 <color=#ffffff>[L]</color> My dad moved to Mars with me after my grandpa's sudden death. @w2 I signed up for the fleet right after college, to show what our family is capable of. @w2 My dad said that Grandpa became crazy about this shit. @w2 Pretending the officials just want to silence everyone. @w2 Especially him personally, and the Hyperion Bereaved organization. @w2 All his stories of a 'planned accident.' @w2 The ship 'not being destroyed' and some 'threat' we are facing - all very dramatic.
@p9 <color=#ffffff>[L]</color> And, to be honest, until the last 24h, I always thought this old poor man simply could not cope with what happened. @w2 When you showed up on board the Titan, I suddenly remembered one of my grandpa's stories, about some 'black suits' visiting the Hyperion a few days ahead of the mission.
@w2 <color=#9c9c9c>[M]</color> Commander. Please...
@w2 <color=#ffffff>[L]</color> I tell you what: 
@p9 <color=#ffffff>[L]</color> I've been working on this project for nearly eight years now, and in these last few months, I've looked at this project and I've done the math. @w2 In the last week, and in the last 24 h in particular, so many strange things have happened.@w2 The GRAND and the TITAN each have several squads of marines on board. I checked the manifests yesterday. @w2 We have stashed away tons and tons and tons of high-caliber ammo. @w2 I am an engineer. I know what these formulas and materials are made for. @w2 This is not for asteroid defense. @w2 And now you are coming on board. @w2 And the first thing you do is mess around with the protocols I have been developing for the last five years.
@p9 <color=#9c9c9c>[M]</color> The adjustments we've made are coming directly from Apollon labs. @w2 Dr Greyson and Dr. Dawson?
@w2 <color=#ffffff>[L]</color> I know them. @w2 But I have also looked at the changes you made. @w2 These are risky. I am not sure what they should do exactly. @w2 They don't seem to have any function that improves the efficiency of the warp drives.
@w2 <color=#9c9c9c>[M]</color> Rest assured, these have been approved by top specialists- everything is fine.
@w2 <color=#ffffff>[L]</color> Rest assured, if something goes wrong .. @w2and someone is harmed .. @w2 and I discover that it was because of your changes .. @w2 nothing will be fine .. @w2 for you.

column3:
Комната управления варп-ядром
@w2 T минус 5:02:13
@w2 Коммандер Ламарр [L]
@w2 Коммандер Мерсер [M]
@p9 <color=#9c9c9c>[M]</color> Здравствуйте, коммандер Ламарр!
@w2 <color=#ffffff>[L]</color> О, здравствуйте коммандер Мерсер. Приятно видеть вас здесь. Я слышал, что вы теперь отвечаете за варп-двигатели и протоколы. @w2 И за то, что вы переписали мои протоколы ремонта и тесты, как только ступили на борт 'Титана'? @w2 Итак, чем я могу вам помочь?
@w2 <color=#9c9c9c>[M]</color> Я как раз осматриваю варп-ядро. @w2 Впечатляет! 
@w2 <color=#ffffff>[L]</color> Да. Невероятно, что техники вытащили из этой кучи хлама в Антарктиде четыре десятилетия назад. 
@p9 <color=#ffffff>[L]</color> Ничего, кроме разрушенных устройств и недоработанных чертежей, но теперь, каким-то волшебным образом, это работает. Вы понимаете, о чем я.
@w2 <color=#9c9c9c>[M]</color> Да, действительно.
@w2 <color=#ffffff>[L]</color> Только вопрос, если вы не возражаете? @w2 Что именно вы здесь делаете?
@w2 <color=#9c9c9c>[M]</color> Как я уже сказал, изучаю варп-ядро и его оптимизацию.
@w2 <color=#ffffff>[L]</color> Хм. @w2 Хорошо. @w2 Тогда приятного отдыха. @w2 Я настраиваю последние процедуры. Или ты хочешь переписать их прямо сейчас?
@w2 <color=#9c9c9c>[M]</color> Не беспокойся. @w2 Кажется, никаких проблем с переносом расписания не было, да? @p9 <color=#ffffff>[L]</color> Эээ, @w2 кхм, @w2 Нет. Конечно. Команды добились исключительного прогресса с тех пор, как какой-то офисный сиделец решил выкинуть их из постели. И это после того, как они уже работали неделями почти без сна.
@w2 <color=#9c9c9c>[M]</color> Очевидно, это риск работы в экспедиционном флоте, верно?
@w2 <color=#ffffff>[L]</color> Ха-ха. Вот что я вам скажу, вся эта история с 'экспедицией' идет по странному пути. Не говоря уже о том, что есть Совет, который принимает все решения, а UCH как-то в тени. @w2 Не кажется ли вам, что это требует какого-то дополнительного... @w2 объяснений?
@p9 <color=#9c9c9c>[M]</color> Нет. Что мы должны объяснять? @w2 Кому? @w2 В экспедиции нет ничего секретного, для тех, кто в ней участвует. @w2 Мы расскажем людям то, что им нужно знать.
@w2 <color=#ffffff>[L]</color> Да. Это как раз моя точка зрения! Как вы, наверное, знаете, мой дедушка был ведущим инженером на 'Гиперионе'. @w2 Он не пропал с корабля только по одной простой причине: кто-то решил перенести его смену. @w2 Я благодарен ему за это, но мой дедушка так и не смог избавиться от клейма 'труса, который остался позади'.
@p9 <color=#ffffff>[L]</color> После внезапной смерти дедушки мой папа переехал на Марс вместе со мной. @w2 Я записался на флот сразу после колледжа, чтобы показать, на что способна наша семья. @w2 Мой папа сказал, что дедушка помешался на этом дерьме. @w2 Делать вид, что чиновники просто хотят заставить всех замолчать. @w2 Особенно ему лично и организации 'Гиперион'. @w2 Все его рассказы о 'запланированной аварии'. @w2 Корабль 'не был уничтожен' и какая-то 'угроза', которой мы подвергаемся - все это очень драматично.
@p9 <color=#ffffff>[L]</color> И, честно говоря, до последних суток я всегда думал, что этот старый бедняга просто не может справиться с тем, что произошло. Когда вы появились на борту 'Титана', я вдруг вспомнил один из дедушкиных рассказов о том, что за несколько дней до миссии на 'Гиперионе' побывали какие-то 'черные костюмы'.
@w2 <color=#9c9c9c>[M]</color> Командор. Пожалуйста...
@w2 <color=#ffffff>[L]</color> Вот что я вам скажу: 
@p9 <color=#ffffff>[L]</color> Я работаю над этим проектом уже почти восемь лет, и за последние несколько месяцев я посмотрел на этот проект и посчитал. За последнюю неделю, и особенно за последние 24 часа, произошло много странных вещей.@w2 На борту кораблей 'Грэнд' и 'Титан' находится по несколько отрядов морских пехотинцев. Я вчера проверил декларации. @w2 Мы спрятали тонны, тонны и тонны боеприпасов высокого калибра. @w2 Я инженер. Я знаю, для чего сделаны эти формулы и материалы. @w2 Это не для защиты от астероидов. @w2 И теперь ты вступаешь в игру. И первое, что вы сделаете, это возитесь с протоколами, которые я разрабатывал последние пять лет.
@p9 <color=#9c9c9c>[M]</color> Внесенные нами изменения поступают непосредственно из лабораторий Аполлона. @w2 Доктор Грейсон и доктор Доусон?
@w2 <color=#ffffff>[L]</color> Я знаю их. Но я также ознакомился с изменениями, которые вы внесли. @w2 Это рискованно. Я не уверен, что именно они должны делать. Похоже, они не выполняют никаких функций, повышающих эффективность варп-двигателей.
@w2 <color=#9c9c9c>[M]</color> Будьте уверены, они были одобрены ведущими специалистами - все в порядке.
@w2 <color=#ffffff>[L]</color> Будьте уверены, если что-то пойдет не так... @w2 и кто-то пострадает... @w2 и я узнаю, что это произошло из-за ваших изменений... @w2 все будет в порядке... @w2 для вас.

column2:
@d0This console enables the exploration of the following technology: <b>DARK FACTION</b>.
Your current research points account for DARK FACTION: <color=#00ffff>{ResearchPoints}</color>

This research console allows for the study of foreign and unknown technologies. To do this, you must collect research points (RP) for the respective technology tree to use in the study of individual technologies.

column3:
@d0Этот консоль позволяет исследовать следующие технологии: <b>ТЕМНАЯ ФРАКЦИЯ</b>.
Ваши текущие очки исследования для ТЕМНОЙ ФРАКЦИИ: <color=#00ffff>{ResearchPoints}</color>

Эта исследовательская консоль позволяет изучать чуждые и неизвестные технологии. Для этого вы должны собирать очки исследования (RP) для соответствующего дерева технологий, чтобы использовать их для изучения отдельных технологий.

column2:
@d0Your current research points account for <color=#ffffff>DARK FACTION</color>: <color=#00ffff>{ResearchPoints}</color>

Research points can be obtained in two ways:
1. Melt down the following items:  {DFresearchDataItem}
2. Transfer found research data:  {DFresearchMeltingItems}

Important: Items and research data must be in your inventory. The connected toolbar cannot be accessed here!

column3:
@d0Ваши текущие очки исследования для <color=#ffffff>ТЕМНОЙ ФРАКЦИИ</color>: <color=#00ffff>{ResearchPoints}</color>

Очки исследования можно получить двумя способами:
1. Переплавить следующие предметы:  {DFresearchDataItem}
2. Передать найденные исследовательские данные:  {DFresearchMeltingItems}

Важно: Предметы и исследовательские данные должны быть в вашем инвентаре. Доступ к связанной панели инструментов здесь невозможен!

