column2:
@q0@d0The FAQ below provides you with information and some tips on the <color=#ffffff>Dark Faction</color> DLC expansion.

Read it carefully before you dive into your adventure, as your new enemies are more cunning than all before!

<color=#ff9500>Important!</color> You can open thist  FAQ at any time: In the <color=#ffffff>PDA</color> (<color=#37ff00>F1</color>) select <color=#ffffff>Tutorial</color> tab, then click the entry <color=#ffffff>Empyriopedia: Dark Faction</color> (left side) and then click on the <color=#ffffff>Activate Tutorial</color> button.

column3:
@q0@d0Ниже приведенный FAQ содержит информацию и некоторые советы по расширению DLC <color=#ffffff>Темная Фракция</color>.

Прочтите его внимательно, прежде чем погрузиться в приключение, так как ваши новые враги более хитры, чем все предыдущие!

<color=#ff9500>Важно!</color> Вы можете открыть этот FAQ в любое время: в <color=#ffffff>PDA</color> (<color=#37ff00>F1</color>) выберите вкладку <color=#ffffff>Учебник</color>, затем нажмите на запись <color=#ffffff>Эмпириопедия: Темная Фракция</color> (слева) и затем нажмите кнопку <color=#ffffff>Активировать учебник</color>.
